new FileFilter(){
  public boolean accept(  File path){
    if (!path.isFile()) {
      return false;
    }
    String name=path.getName().toLowerCase(Locale.ENGLISH);
    return (name.startsWith("jetty") && name.endsWith(".xml"));
  }
}

